import "./Title.css";

// assets
import Mario from "../../../assets/img/mario.png";

const Title = () => {
  return (
    <div className="title-container">
        <img src={Mario} alt="" className="mario-logo"/>
        <h1 className="title">Mario Jump</h1>
    </div>
  )
}
export default Title;
